import MainContent from "./src/navigations/MainContent";
import { SafeAreaProvider, SafeAreaView } from "react-native-safe-area-context";
import InfoMovie from "./src/screens/InfoMovie";

export default function App() {
  return (
    <SafeAreaProvider>
      <InfoMovie />
